--
-- Name: ins_inv(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION ins_inv() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
v_amount					real;
reca				record;
v_interests			real;
BEGIN

SELECT investment_type_id, investment_id, repayment_period, default_interest, monthly_returns, monthly_payments, total_payment, total_returns, total_repayment_amount INTO reca
FROM investments 
WHERE investment_id = NEW.investment_id;

	SELECT interest_amount INTO v_interests FROM  investment_types 
	WHERE investment_type_id = reca.investment_type_id;
	
	NEW.default_interest := v_interests;
	v_amount = (New.total_cost * (v_interests/100)) ;
	reca.total_repayment_amount := v_amount + New.total_cost; 
	NEW.total_repayment_amount := reca.total_repayment_amount;

	IF (reca.monthly_payments is null) THEN
	
		NEW.monthly_payments := reca.total_repayment_amount/reca.repayment_period;

	ELSIF (reca.repayment_period is null) THEN
		NEW.repayment_period := reca.total_repayment_amount/reca.monthly_payments;
	ELSIF (reca.repayment_period is null AND reca.monthly_payments is null) THEN
		RAISE EXCEPTION 'Please enter the repayment period or the monthly payments';
	ELSEIF (reca.monthly_payments is not null) THEN	
		reca.total_payment  := COALESCE(reca.monthly_payments, 0) + COALESCE(NEW.monthly_payments, 0);

	UPDATE investments SET monthly_payments = reca.monthly_payments, total_payment = reca.total_payment
	  WHERE investment_id = reca.investment_id AND is_complete = false;
	RAISE NOTICE '%',reca.monthly_payments;		
	
	END IF;
	
	IF (reca.total_payment >= reca.monthly_payments) THEN
		UPDATE investments SET is_complete = true WHERE is_complete = false and investment_id = reca.investment_id;
	END IF;

	IF (reca.monthly_returns is not null) THEN
		reca.total_returns := COALESCE(reca.total_returns, 0) + COALESCE(NEW.monthly_returns,0);
		UPDATE investments SET monthly_returns = reca.monthly_returns, total_returns = reca.total_returns WHERE investment_id = NEW.investment_id;

	END IF;

	
RETURN NEW;
END;
$$;


