            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            vw_loan_monthly.org_id
           FROM vw_loan_monthly
        UNION
         SELECT 'Investment'::character varying(50) AS title,
            vw_investments.date_of_accrual AS date,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            vw_investments.principal,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            vw_investments.org_id
           FROM vw_investments
        UNION
         SELECT 'borrowing'::character varying(50) AS title,
            vw_borrowing.borrowing_date AS date,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            vw_borrowing.principle,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            vw_borrowing.org_id
           FROM vw_borrowing
        UNION
         SELECT 'Penalty'::character varying(50) AS title,
            vw_penalty.date_of_accrual AS date,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            vw_penalty.amount,
            (0)::real AS float4,
            (0)::real AS float4,
            vw_penalty.org_id
           FROM vw_penalty
        UNION
         SELECT 'Income'::character varying(50) AS title,
            vw_tx_ledger.transaction_date AS date,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            vw_tx_ledger.dr_amount,
            (0)::real AS float4,
            vw_tx_ledger.org_id
           FROM vw_tx_ledger
          WHERE (vw_tx_ledger.tx_type = 1)
        UNION
         SELECT 'Expenditure'::character varying(50) AS title,
            vw_tx_ledger.transaction_date AS date,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            (0)::real AS float4,
            vw_tx_ledger.cr_amount,
            vw_tx_ledger.org_id
           FROM vw_tx_ledger
          WHERE (vw_tx_ledger.tx_type = (-1))) a
  ORDER BY a.date;


