CREATE VIEW vw_skills AS
 SELECT vw_skill_types.skill_category_id,
    vw_skill_types.skill_category_name,
    vw_skill_types.skill_type_id,
    vw_skill_types.skill_type_name,
    vw_skill_types.basic,
